import React, { Component } from 'react';
import Customer from './components/Customer'
import './App.css';

const customer = {
  'name': '김진석',
  'birthday': '910929',
  'gender': '남자',
  'job': 'Developer'
}

class App extends Component {
  render() {
    return (
      <Customer 
        name={customer.name}
        birthday={customer.birthday}
        gender={customer.gender}
        job={customer.job}
      />
    );
  }
}

export default App;
